● महाराजा गंगासिंह ने 1902 में, इस भव्य राजमहल का निर्माण, अपने स्वर्गीय पिता महाराजा लाल सिंह की स्मृति में करवाया था<br />
● यह महल पूरी तरह से लाल बलुआ पत्थर से निर्मित किया गया है तथा राजपूताना, इस्लामी तथा यूरोपीय वास्तुकला के मिश्रण से इसे मूर्तरूप प्रदान किया गया।<br />
● इसी पैलेस के एक हिस्से में श्री शार्दुल म्यूजियम है।&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;

- मुख्य सचिव सचिवालय का प्रधान होता है।<br />
- इसका नियंत्रण सचिवालय के सभी विभागों पर होता है।<br />
- &lsquo;मुख्यमंत्री का सलाहकार होता है&nbsp;

● निदानात्मक परीक्षण, छात्रों की कमियों को दूर करने के लिए उपचारात्मक शिक्षण की व्यवस्था में सहायक है। निदानात्मक परीक्षण वे परीक्षण है जो इस बात का निदान करते हैं कि छात्र किन-किन परिस्थितियों में गलतियाँ करते है, उनकी त्रुटियाँ या गलतियाँ किस प्रकार की है तथा उनके क्या कारण है?<br />
<strong>अतिरिक्त जानकारी -&nbsp;</strong><br />
● उपलब्धि परीक्षण द्वारा किसी विशेष कार्य क्षेत्र में छात्रों द्वारा अर्जित किए गए ज्ञान एवं कौशल को मापा जाता है। विद्यालय में औपचारिक शिक्षण के लिए उपलब्धि का मापन आवश्यक है। शिक्षा प्रक्रिया को पूर्ण एवं प्रभावशाली बनाने एवं अधिगम स्रोतों के कुशल प्रयोग हेतु विशेष प्रेरणा एवं निर्देशन की आवश्यकता होती है। उपलब्धि परीक्षण यह जानने के लिए प्रयोग में लाए जाते हैं कि बालक ने क्या और कितना सीखा है तथा वह कोई कार्य कितनी भली-भाँति कर सकता है। इस प्रकार बालक विद्यालय में रहकर जो कुछ सीखता है, उसे हम उपलब्धि या निष्पत्ति (Achievement) कहते हैं तथा इस उपलब्धि की जाँच हेतु जो परीक्षाएँ आयोजित की जाती हैं, उन्हें उपलब्धि /निष्पत्ति परीक्षण (Achievement Test) कहते हैं।&nbsp;
